import { Socket, io } from "socket.io-client"
import { FullMessage } from "./chat";
import Config from "./config";
import User from "./user";

class ChatConfig {
    socket: Socket

    constructor(config: Config) {
        this.socket = io(config.test ? config.localhostSocketPath : config.productionSocketPath);
    }



    channelId?: string = undefined
    members: User[] = []
    name: string = ""
    lastMessage?: FullMessage
    //** the channel avatar */
    avatar?: string
}

export default ChatConfig

