import ChatConfig from "./chat-config";
import axios from "axios"
import Config from "./config";
import User from "./user";
import Message from "./message";



type MessagesResponse = {
    messages: FullMessage[],
    success: boolean,
    page: number,
    totalMessages: number,
    totalPages: number
}

export type FullMessage = {
    user: User
    message: Message
}
class Chat {
    // the config object for ChatBunny
    mainConfig: Config
    //the config object for this chat object
    config: ChatConfig


    constructor(minChatConfig: Config) {
        this.mainConfig = minChatConfig
        this.config = new ChatConfig(minChatConfig)
    }


    getId() {
        return this.config.channelId
    }

    getName() {
        return this.config.name
    }

    getChatAvatar() {
        return this.config.avatar
    }

    getMembers(): User[] {
        return this.config.members
    }

    getLastMessage(): FullMessage | undefined {
        return this.config.lastMessage
    }
    /**
     * 
     */
    async getMessages(page?: number, callback?: (chats: MessagesResponse) => void): Promise<MessagesResponse> {
        //todo handle error responses


        const params = {
            members: this.config.members,
            channelId: this.config.channelId,
            user: this.mainConfig.user,
            name: this.config.name,
            demo: this.mainConfig.demo,
            apiKey: this.mainConfig.apiKey,
            page

        }

        //todo dynamically switch url between development and production
        const response = await axios.get((this.mainConfig.test ? this.mainConfig.localhostPath : this.mainConfig.productionPath) + '/messages', {
            params,
        })

        //join the channel
        this.config.socket.emit('room.join', { channelId: response.data.channelId })

        callback && callback(response.data)
        //todo handle a response that fails
        return response.data
    }

    /**
     * 
     * @param param0 
     * @param callback - callback function to know the status of the message being sent whether it was successful or there was an error
     */
    sendMessage({ text }: Message, callback?: (error: boolean, success: boolean) => void) {
        //update the last message of this chat item //update it still even if the message fails to send
        this.config.lastMessage = {
            user: this.mainConfig.user,
            message: { text }
        }

        //emit the message to the socket server
        this.config.socket.emit('message', {
            text,
            apiKey: this.mainConfig.apiKey,
            channelId: this.config.channelId,
            user: this.mainConfig.user,
            members: this.config.members,
            name: this.config.name,
            demo: this.mainConfig.demo
        },
            // callback function from the socket server which is when when the emit succeeds or fails
            (err: any, success: any) => {
                //pass on to the callback if it is defined
                callback && callback(err ? true : false, success ? true : false)
            });


    }

    onMessage(listener: (data: any) => void) {
        //channel is already defined so listen to the room
        if (this.config.channelId) {
            this.config.socket.emit('room.join', { channelId: this.config.channelId })
        }

        this.config.socket.on('message', (data) => {

            //update the last message
            if (data.success) {
                this.config.lastMessage = {
                    user: {
                        id: data.user.id,
                        name: data.user.name,
                        avatar: data.user.avatar
                    },
                    message: {
                        text: data.message.text
                    }
                }
            }

            listener && listener(data)
        });
    }

    onError(listener: (data: any) => void) {
        this.config.socket.on('error', (data) => {
            listener && listener(data.message)
        });
    }

    release() {
        this.config.socket.emit('room.leave', { channelId: this.config.channelId })

        this.config.socket.off('message')
        this.config.socket.off('error')

    }
}

export default Chat

