import Chat from "./chat";
import Config from "./config";
import axios from "axios"
import User from "./user";

export type GroupChatProps = {
   members: User[]
   name: string
}

type ChatsResponse = {
   chats: Chat[],
   success: boolean,
   page: number,
   totalChats: number,
   totalPages: number
}

export class MinChatInstance {
   config: Config

   constructor(MINCHAT_API_KEY: string | number) {
      this.config = new Config()
      this.config.apiKey = MINCHAT_API_KEY

   }



   /**
  * 
  */
   async getChats(page?: number, callback?: (chats: ChatsResponse) => void): Promise<ChatsResponse> {
      //todo handle error responses

      const params = {
         user: this.config.user,
         demo: this.config.demo,
         apiKey: this.config.apiKey,
         page
      }

      const response = await axios.get((this.config.test ? this.config.localhostPath : this.config.productionPath) + '/chats', { params })

      //todo handle a response that fails
      const chats: Chat[] = []

      const localConfig = this.config

      response.data.chats.forEach((chatItem: any) => {
         const chat = new Chat(localConfig)
         chat.config.channelId = chatItem.id
         chat.config.name = chatItem.name
         chat.config.members = chatItem.participantUserIds
         chat.config.lastMessage = {
            user: {
               id: chatItem.lastMessage.user.id,
               name: chatItem.lastMessage.user.name,
               avatar: chatItem.lastMessage.user.avatar,
            },
            message: {
               text: chatItem.lastMessage.text
            }
         }

         chat.config.avatar = chatItem.avatar

         chats.push(chat)
      })

      response.data.chats = chats

      //pass the data into the callback
      callback && callback(response.data)

      //return the data in the function if using async await
      return response.data
   }


   connectUser(user: User): MinChatInstance {
      this.config.user = user
      return this
   }

   chat(withUser: User): Chat {
      const chat = new Chat(this.config)
      chat.config.members = [withUser]
      chat.config.name = withUser?.name && withUser?.name.trim().length > 0 ? withUser.name : "No Name"
      return chat
   }

   groupChat({ members, name }: GroupChatProps): Chat {
      const chat = new Chat(this.config)
      chat.config.members = members
      chat.config.name = name && name.trim().length > 0 ? name.trim() : "Group Chat"
      return chat
   }
}

class MinChat {
   static getInstance(MINCHAT_API_KEY: string | number): MinChatInstance {
      return new MinChatInstance(MINCHAT_API_KEY)
   }
}

declare global {
   interface Window {
      MinChat: {
         getInstance: (MINCHAT_API_KEY: string | number) => MinChatInstance
      };
   }
}

window.MinChat = {
   getInstance: MinChat.getInstance
}


export default MinChat
